}

const DishDetail = (props) => {
  return (
    <>
      <div key={props.dish.id} className="container">
        <div className="row">
          {props.dish && props.dish.map((dish) => <RenderDish dish={dish} />)}
        </div>
      </div>
    </>
  );
};
export default DishDetail;
